	"description": "<h4>You&apos;re a player</h4> When we saw the name of this shirt, we were a little nervous. Imagine our relief to find out it&apos;s not a shirt about David Blaine. Look. Look. See. Look.&#xA0;<br><br>Our favorite magic users can read this &quot;Straight Outta Mana&quot; statement shirt two different ways:\n<ol>\n<li>The obvious one: you could be completely bereft of mana. Maybe you were mana hosed by your cards in MtG or you freaked out and accidentally blew all your mana on the first creep wave in LoL. Pro packing tip: always bring more mana than you think you&apos;re going to need. Like charging cables, you&apos;ll be glad you have it at the end of the day.\n</li><li>Or you could take it as meaning whatever you just did is PURELY powered by mana. This fireball? Straight out of mana, monkey mofos. Boom.\n</li></ol>\nStraight Outta Mana in white ink on the front of this black 100% cotton shirt. Machine wash cold. Tumble dry low or lay flat to dry. Imported.&#xA0;<br><br><b>Because this is a limited-edition shirt, we&apos;re sorry, but there are NO RETURNS OR EXCHANGES.</b>",
