	"description": "<h4>Celebrate with BB-8</h4> There&apos;s one thing we can all agree on: BB-8 needs to be hugged. The little round body. The slight head tilt. It just calls for corporal cuddling.&#xA0;<br><br>However, if you have the Sphero version of BB-8, you can&apos;t really hug it. Well, you could, but you&apos;d have to be careful, and it&apos;s not really of a size where a real HUG is possible. You&apos;d probably be best just patting it on the head and letting it go on its merry way.&#xA0;<br><br>This Life Size BB-8 Plush promises not to go on its merry way before you get a hug in. That&apos;s because it has no motor inside. Just stuffin&apos;. Did we mention it&apos;s 2 feet tall? It&apos;s weighted so the head stays mostly upright. Because nobody wants an upside-down droid, even a plush one.<br><br><b>Product Specifications&#xA0;</b><br><ul><li>Life Size BB-8 Plush</li><li>Officially-licensed <i>Star Wars: The Force Awakens</i> merchandise</li><li>A ThinkGeek exclusive</li><li>Head does not turn</li><li>Materials: Polyester fibers &amp; plastic pellets</li><li>Care Instructions: Machine wash cold</li><li>(Good luck finding a machine it&apos;ll fit in)</li><li>Imported&#xA0;</li><li>Dimensions: 2&apos; tall x 18&quot; diameter</li><li>Weight: 5 1/2 lbs.</li><li><b>Ages 3+</b></li></ul><br>",
