	"description": "<h4>Let this droid help you awaken</h4> BB-8&apos;s &quot;thumbs up&quot; is so adorable. It makes us feel like we&apos;re listening to a power ballad. But as a light source it&apos;s not really sufficient. And it&apos;s got the added risk of open flame. You know us. We are not to be trusted around fire. So it&apos;s best to put that &quot;thumbs up&quot; away and get your light another way.<br><br>This BB-8 Life-Size LED Floor Lamp stands 28 1/2&quot; tall and casts light on your subject of choice, whether that&apos;s astronavigation or algebra. It has strings of LED lights inside the head, which shine downwards through a diffuser. A gentle tap on BB-8&apos;s head switches between three different lighting modes: cold white, amber, and warm white. And off. Also a good mode when you need to go to sleep.<br><br><b>Product Specifications&#xA0;</b><br><ul><li>BB-8 Life-Size LED Floor Lamp</li><li>Officially-licensed <i>Star Wars: The Force Awakens</i> merchandise</li><li>A ThinkGeek exclusive&#xA0;</li><li>Comes with stand so it doesn&apos;t go off adventuring</li><li>Three different lighting modes: cold white, amber, and warm white</li><li>Tap BB-8&apos;s head to switch lighting modes (or turn off)</li><li>Materials: Metal with decals &amp; LEDs</li><li>Dimensions: 28 1/2&quot; tall x 20&quot; diameter</li><li>Weight: 15 lbs.</li><li>Includes lamp and switching power supply (6 ft. white cable)</li><li>Power supply input: 110-240V ~ 50-60Hz .8A&#xA0;</li><li>Power supply output: DC 12v 2.5A</li></ul>",
